import React from 'react';
import './App.css';
import { Alert, Container } from 'reactstrap';

function App() {
  return (
    <div className="App">
      <Alert color="primary">
        <h1>Quản lý công việc</h1>
      </Alert>
      <Container>
        <Row>
          <Col md="4">
            Form
          </Col>
          <Col md="8">
            Action
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
